import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import Modal from "react-modal";
import EmailPopup from "./EmailPopup";

Modal.setAppElement("#root");

function Home() {
  const [showModal, setShowModal] = useState(false);

  const openModal = () => {
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
  };

  // Define the threshold values for X and Y coordinates
  const thresholdX = 100; // Adjust this value as needed
  const thresholdY = 10; // Adjust this value as needed

  // Track mouse position
  function handleMouseMove(ev) {
    const mouseX = ev.clientX;
    const mouseY = ev.clientY;

    // Check if the cursor position is within the threshold to trigger the modal
    if (mouseY <= thresholdY && mouseX >= thresholdX) {
      console.log("Mouse in threshold - open modal");
      openModal();
    } else {
      console.log("Mouse outside threshold - close modal");
      closeModal();
    }
  }


  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
  console.log(showModal);
  // console.log(modalPosition);
  return (
    <div>
      <div id="home-page-1">
        <NavLink to="/cocktail-generator">
          <img
            id="mixing-button-image"
            src={process.env.PUBLIC_URL + "/images/homepage/Home7.png"}
            alt="login"
          />
        </NavLink>

        <img
          id="bartender-image"
          src={process.env.PUBLIC_URL + "/images/homepage/Home2.png"}
          alt="speech-trainer-logo"
        />
      </div>
      <div id="home-page-2">
        <div className="row-3">
          <div className="column-2">
            <NavLink to="/cocktail-generator">
              <div className="image-container">
                <img
                  id="video-speech-trainer-logo"
                  src={process.env.PUBLIC_URL + "/images/homepage/Products.png"}
                  alt="Video Speech Trainer"
                />
              </div>
            </NavLink>
          </div>

          <div className="column-2">
            <NavLink to="/drink-search">
              <img
                id="first-words-logo"
                src={process.env.PUBLIC_URL + "/images/homepage/Products1.png"}
                alt="Video Speech Trainer"
              />
            </NavLink>
          </div>
          <div className="column-2">
            <NavLink to="/mocktail-search">
              <img
                id="games-logo"
                src={
                  process.env.PUBLIC_URL + "/images/homepage/mocktail-logo.png"
                }
                alt="Video Speech Trainer"
              />
            </NavLink>
          </div>
        </div>
        <div className="row-4">
          <NavLink to="/cocktail-generator">
            <img
              id="cocktail-generator-image"
              src={
                process.env.PUBLIC_URL +
                "/images/homepage/cocktail-generator.png"
              }
              alt="home-learning-center"
            />
          </NavLink>
          <NavLink to="/drink-search">
            <img
              id="cocktail-search-image"
              src={
                process.env.PUBLIC_URL + "/images/homepage/cocktail-search.png"
              }
              alt="home-learning-center"
            />
          </NavLink>
          <NavLink to="/mocktail-search">
            <img
              id="mocktail-search-image"
              src={
                process.env.PUBLIC_URL + "/images/homepage/mocktail-search.png"
              }
              alt="home-learning-center"
            />
          </NavLink>
        </div>
      </div>
      <div onMouseMove={(ev) => handleMouseMove(ev)}></div>

      {showModal && (
        <Modal
          isOpen={showModal}
          contentLabel="Example Modal"
          onRequestClose={closeModal}
          style={{
            overlay: {
              backgroundColor: "rgba(0, 0, 0, 0.5)",
            },
            content: {
              top: mousePosition.top, // Pass the top position
              left: mousePosition.left, // Pass the left position
              // You can add other styles here if needed
            },
          }}
        >
          {/* Render the EmailPopup component */}
          <EmailPopup />
        </Modal>
      )}
    </div>
  );
}

export default Home;
